class Form_a: public dolfin::Form
{
public:

  // Constructor
  Form_a(std::shared_ptr<const dolfin::FunctionSpace> V1, std::shared_ptr<const dolfin::FunctionSpace> V0):
    dolfin::Form(2, 8), phase(*this, 0), GX(*this, 1), K(*this, 2), kappa(*this, 3), mmk(*this, 4), smk(*this, 5), jmk(*this, 6), imk(*this, 7)
  {
    _function_spaces[0] = V0;
    _function_spaces[1] = V1;

    _ufc_form = std::make_shared<const bloch_torrey_notime3d_form_0>();
  }

  // Constructor
  Form_a(std::shared_ptr<const dolfin::FunctionSpace> V1, std::shared_ptr<const dolfin::FunctionSpace> V0, std::shared_ptr<const dolfin::GenericFunction> phase, std::shared_ptr<const dolfin::GenericFunction> GX, std::shared_ptr<const dolfin::GenericFunction> K, std::shared_ptr<const dolfin::GenericFunction> kappa, std::shared_ptr<const dolfin::GenericFunction> mmk, std::shared_ptr<const dolfin::GenericFunction> smk, std::shared_ptr<const dolfin::GenericFunction> jmk, std::shared_ptr<const dolfin::GenericFunction> imk):
    dolfin::Form(2, 8), phase(*this, 0), GX(*this, 1), K(*this, 2), kappa(*this, 3), mmk(*this, 4), smk(*this, 5), jmk(*this, 6), imk(*this, 7)
  {
    _function_spaces[0] = V0;
    _function_spaces[1] = V1;

    this->phase = phase;
    this->GX = GX;
    this->K = K;
    this->kappa = kappa;
    this->mmk = mmk;
    this->smk = smk;
    this->jmk = jmk;
    this->imk = imk;

    _ufc_form = std::make_shared<const bloch_torrey_notime3d_form_0>();
  }

  // Destructor
  ~Form_a()
  {}

  /// Return the number of the coefficient with this name
  virtual std::size_t coefficient_number(const std::string& name) const
  {
    if (name == "phase")
      return 0;
    else if (name == "GX")
      return 1;
    else if (name == "K")
      return 2;
    else if (name == "kappa")
      return 3;
    else if (name == "mmk")
      return 4;
    else if (name == "smk")
      return 5;
    else if (name == "jmk")
      return 6;
    else if (name == "imk")
      return 7;

    dolfin::dolfin_error("generated code for class Form",
                         "access coefficient data",
                         "Invalid coefficient");
    return 0;
  }

  /// Return the name of the coefficient with this number
  virtual std::string coefficient_name(std::size_t i) const
  {
    switch (i)
    {
    case 0:
      return "phase";
    case 1:
      return "GX";
    case 2:
      return "K";
    case 3:
      return "kappa";
    case 4:
      return "mmk";
    case 5:
      return "smk";
    case 6:
      return "jmk";
    case 7:
      return "imk";
    }

    dolfin::dolfin_error("generated code for class Form",
                         "access coefficient data",
                         "Invalid coefficient");
    return "unnamed";
  }

  // Typedefs
  typedef Form_a_FunctionSpace_0 TestSpace;
  typedef Form_a_FunctionSpace_1 TrialSpace;
  typedef Form_a_MultiMeshFunctionSpace_0 MultiMeshTestSpace;
  typedef Form_a_MultiMeshFunctionSpace_1 MultiMeshTrialSpace;
  typedef Form_a_FunctionSpace_2 CoefficientSpace_phase;
  typedef Form_a_FunctionSpace_3 CoefficientSpace_GX;
  typedef Form_a_FunctionSpace_4 CoefficientSpace_K;
  typedef Form_a_FunctionSpace_5 CoefficientSpace_kappa;
  typedef Form_a_FunctionSpace_6 CoefficientSpace_mmk;
  typedef Form_a_FunctionSpace_7 CoefficientSpace_smk;
  typedef Form_a_FunctionSpace_8 CoefficientSpace_jmk;
  typedef Form_a_FunctionSpace_9 CoefficientSpace_imk;

  // Coefficients
  dolfin::CoefficientAssigner phase;
  dolfin::CoefficientAssigner GX;
  dolfin::CoefficientAssigner K;
  dolfin::CoefficientAssigner kappa;
  dolfin::CoefficientAssigner mmk;
  dolfin::CoefficientAssigner smk;
  dolfin::CoefficientAssigner jmk;
  dolfin::CoefficientAssigner imk;
};

